#! /bin/bash

##GITHUB SEM ICONE
cd ~ && 
nativefier --name Github https://github.com/ && 
cd /home/$USER/Github-linux-x64 && 
cd resources/app && 
mkdir static && 
cd ../.. && 
mv /home/$USER/Github-linux-x64 /home/$USER/github && 
cd .. && 
sudo mv github /opt && 
sudo ln -sf /opt/github/Github /usr/bin/github && 
echo -e '[Desktop Entry] Version=1.0 Name=github Exec=/opt/github/Github Icon=/opt/github/resources/app/static/Icon.png Type=Application
 Categories=Application' | sudo tee /usr/share/applications/github.desktop ; 
 
 ##AMAZON
 cd ~ && 
 nativefier --name Amazon https://www.amazon.com.br/ && 
 cd /home/$USER/Amazon-linux-x64 && 
 cd resources/app && 
 mkdir static && 
 cd static || 
 echo '' > image.txt && 
 base64 --decode image.txt > Icon.png || 
 cd ../../.. && 
 mv /home/$USER/Amazon-linux-x64 /home/$USER/amazon && 
 cd .. && 
 sudo mv amazon /opt && 
 sudo ln -sf /opt/amazon/Amazon /usr/bin/amazon && 
 echo -e '[Desktop Entry]
 Version=1.0
 Name=amazon
 Exec=/opt/amazon
 /Amazon Icon=/opt/amazon/resources/app/static/Icon.png
 Type=Application
 Categories=Application' | sudo tee /usr/share/applications/amazon.desktop ;

